const TickIcon = () => {
  return (
    <svg
      style="color: rgb(232, 233, 238);"
      xmlns="http://www.w3.org/2000/svg"
      width="25"
      height="25"
      viewBox="0 0 512 512"
    >
      <title>ionicons-v5-e</title>
      <path
        d="M448,256c0-106-86-192-192-192S64,150,64,256s86,192,192,192S448,362,448,256Z"
        style="fill:none;stroke:#e8e9ee;stroke-miterlimit:10;stroke-width:32px"
        fill="#000"
      ></path>
      <polyline
        points="352 176 217.6 336 160 272"
        style="fill:none;stroke:#e8e9ee;stroke-linecap:round;stroke-linejoin:round;stroke-width:32px"
      ></polyline>
    </svg>
  );
};

export default TickIcon;
